"QToolBar > QToolButton#qt_toolbutton_menubutton:open {\n"
"    border: 1px solid #7cabf9;\n"
"}\n"
"\n"
"QToolBar QToolButton::menu-button,\n"
"QToolBar > QToolButton#qt_toolbutton_menubutton::menu-button {\n"
"    border: none;\n"
"    border-top-right-radius: 3px;\n"
